import React, {Component} from 'react';
import {Navbar ,Nav, NavItem} from 'react-bootstrap';
import{Link} from 'react-router-dom';

export default class CustomNavBar extends Component{
    render(){
        return(
            <Navbar default collapseOnSelect>
              <Navbar.Header>
                  <Navbar.Brand>
                      <Link to="/">MSM</Link>
                  </Navbar.Brand>
                  <Navbar.Toggle/>
              </Navbar.Header>
              <Navbar.Collapse>
                  <Nav pullRight>
                   <NavItem>
                       Home
                   </NavItem>
                  </Nav>
              </Navbar.Collapse>
            </Navbar>
        )
    }
}
